const text_en = `WebAssembly Web Assembly Logo.svg Paradigm Imperative, structured,
expression-oriented Developer W3C First appeared March 2017;
1 year ago Typing discipline Static OS Web License Apache 2.0 License
Filename extensions .wat, .wasm Website webassembly.org Influenced by asm.js,
PNaCl WebAssembly (Wasm, WA) is a web standard that defines a binary format and
a corresponding assembly-like text format for executable code in Web pages.
It is meant to enable executing code nearly as fast as running native machine code.
It was envisioned to complement JavaScript to speed up performance-critical parts of
web applications and later on to enable web development in languages other than JavaScript.[1][2][3]`;

const text_cn = `WebAssembly或称wasm是一个实验性的低级编程语言，应用于浏览器内的客户端。
WebAssembly是便携式的抽象语法树[1]，被设计来提供比JavaScript更快速的编译及运行[2]。
WebAssembly将让开发者能运用自己熟悉的编程语言（最初以C/C++作为实现目标）编译，
再藉虚拟机引擎在浏览器内运行[3]。
   WebAssembly的开发团队分别来自Mozilla、Google、Microsoft、Apple，
代表着四大网络浏览器Firefox、Chrome、Microsoft Edge、Safari[4]。
2017年11月，所有以上四个浏览器都开始实验性的支持WebAssembly`;

